import React from 'react';
import Header from "./Header.js";
import Nav from "./Nav.js";
import './App.css';
import Main from "./Main.js";

const App = function() {
  return ( 
    <div className="App"> 
      <Header />
      <div className="block">
        <Nav />
        <Main />

      </div>
    </div> 
  );
}

export default App;
